import React from 'react';
import Button from "react-bootstrap/Button";
import Navbar from "react-bootstrap/Navbar";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faSignOutAlt } from '@fortawesome/free-solid-svg-icons'
import { faBoxOpen } from '@fortawesome/free-solid-svg-icons'
import { faCoins } from '@fortawesome/free-solid-svg-icons'

export default class NavbarComponent extends React.Component{
    render() {
        return (
            <Navbar>
                <Navbar.Item class="nav-item">
                    <Navbar.Link href="#"><FontAwesomeIcon icon={faBoxOpen}/> Open Packs</Navbar.Link>
                </Navbar.Item>
                <Navbar.Item class="nav-item">
                    <Navbar.Link href="#"><FontAwesomeIcon icon={faCoins}/> Shop</Navbar.Link>
                </Navbar.Item>
                <Navbar.Item class="nav-item">
                    <Navbar.Link href="#"><FontAwesomeIcon icon={faSignOutAlt}/> Sign Out</Navbar.Link>
                </Navbar.Item>
            </Navbar>
            
        );
    }
}
